class automata(object):
    """ 
    https://docs.gap-system.org/pkg/automata/doc/chap2.html
    class to mimic an automata!
    The alphabet should be an instance of the class alphabet. 
    The initial state should be a list. Unless the fsa is a mipda, this
    list will have one element. The attribute "accepting" should be a list
    of accepting states. The table should be an instance of the class table. 
    """
    def __init__(self, inType, inSize, inAlphabet, inInitial, inAccepting, inTransitionTable):
        self.Type = inType #"det", "nondet", or "epsilon"
        self.Size = inSize #positive integer representing the number of states
        self.Alphabet = inAlphabet #number of letters or a list of letters of the ordered alphabet
        #By default it is {a,b,c,...} (or {a_1,a_2,a_3,...} in the case of alphabets with more than 26 letters).
        self.TransitionTable = inTransitionTable #transition matrix written as a list of lists
        self.Initial = inInitial #list of initial state(s)
        self.Accepting = inAccepting #list of accepting states
    def __str__(self):
        gap_string = "Automaton( \n \"" + self.Type + "\",\n"
        gap_string = gap_string + str(self.Size) + ",\n"
        gap_string = gap_string + str(self.Alphabet) +",\n"
        gap_string = gap_string + "["
        for iRow in range(len(self.TransitionTable)-1):
            gap_string = gap_string + str(self.TransitionTable[iRow])+",\n"
        gap_string = gap_string + str(self.TransitionTable[len(self.TransitionTable)-1]) + "\n"
        gap_string = gap_string + "], \n"
        gap_string = gap_string + str(self.Initial) + ",\n" 
        gap_string = gap_string + str(self.Accepting) + ");\n"
        return gap_string    
        
def gap_script(automaton, file_dir, file_name, output_file_name):
    f = open(file_dir+file_name, "w")
    f.write("LoadPackage(\"automata\");"+ "\n")
    #type, state size, alphabet size, transition table, initial , accepting
    f.write("aut :=" + str(automaton)+ "\n")
    f.write("temp1AutMin := MinimalizedAut(aut);"+ "\n")
    f.write("temp2AutMin := RemovedSinkStates(temp1AutMin);"+"\n")
    f.write("autMin := NormalizedAutomaton(temp2AutMin);"+"\n")
    f.write("LogTo(\""+file_dir+output_file_name+"\");"+ "\n")
    f.write("Print(\"Alphabet:\", AlphabetOfAutomaton(autMin), \"\\n\" );"+ "\n")
    f.write("Print(\"States:\", \"\\n\");"+ "\n")
    f.write("Print(\"Number:\", NumberStatesOfAutomaton(autMin), \"\\n\" );"+ "\n")
    f.write("Print(\"Initial:\", InitialStatesOfAutomaton(autMin), \"\\n\");"+ "\n")
    f.write("Print(\"Accepting:\", FinalStatesOfAutomaton(autMin), \"\\n\");"+ "\n")
    f.write("Print(\"Transitions:\", TransitionMatrixOfAutomaton(autMin), \"\\n\");"+ "\n")
    f.write("LogTo();"+ "\n")
    f.write("QUIT;")
    f.close()
        
def read_automata_from_file(file_dir, file_name):
    f = open(file_dir+file_name, "r")
    try:
        #read in all lines and store them in a list
        file_lines=f.readlines()
        print("In read automata from file function")
        #find break points for different info
        bad_chars=[ "[", "]", "\n", " "]
        for iLine in range(len(file_lines)):
            if "Alphabet" in file_lines[iLine]:
                index0 = iLine
            if "Number" in file_lines[iLine]:
                index1 = iLine
            if "Initial" in file_lines[iLine]:
                index2 = iLine
            if "Accepting" in file_lines[iLine]:
                index3 = iLine
            if "Transitions" in file_lines[iLine]:
                index4 = iLine
            #for each line, remove unnecessary 
            for s in bad_chars:
                file_lines[iLine]=file_lines[iLine].replace(s, str())
                    
        #create alphabet info
        numAlphabet = int(file_lines[index0].replace("Alphabet:", str()))
        
        #create state info
        numStates = int(file_lines[index1].replace("Number:", str()))
        initState = file_lines[index2].replace("Initial:", str())
        initState = [int(initState)]
        
        acceptStateLines = file_lines[index3:index4]
        acceptStateLines = "".join(acceptStateLines)
        acceptStates = acceptStateLines.replace("Accepting:", str())
        acceptStates = acceptStates.split(",")
        for i in range(len(acceptStates)):
            acceptStates[i]=int(acceptStates[i])
        
        print("numAlphabet", numAlphabet, type(numAlphabet))
        print("numStates", numStates, type(numStates))
        print("initState", initState, type(initState))
        print("acceptStates", acceptStates, type(acceptStates))
        
        #creates the table and transposes it
        tableLines = file_lines[index4:]
        str_table=' '.join(tableLines[:])#join all lines
        #remove inner spaces
        str_table=str_table.strip()
        
        #remove the characters [ ]
        bad_chars=[ "[", "]", "Transitions:"]
        for s in bad_chars:
            str_table=str_table.replace(s, "")
        
        
        #split str_table by commas to give list as strings
        str_table=str_table.split(",")
        print("table as string", str_table)
        #join together entries according to the size of the states and 
        #convert entries from strings to integers (for printing later)
        table = []
        for i in range(numAlphabet):
            temp_row=str_table[0+i*numStates : numStates*(i+1)]
            for j in range(len(temp_row)):
                temp_row[j]=int(temp_row[j])
            table.append(temp_row)
        
        #Transpose to kbmag ordering
        fsaTable = table_transpose(table, numStates, numAlphabet)
        return numStates, initState, acceptStates, fsaTable
    finally:
        f.close()


def table_transpose(table, nCol, nRow):
    print(type(table), table )
    table_array = np.array(table)
    new_table_array = np.array([[0 for i in range(nRow)] for j in range(nCol)])
    for iRow in range(nRow):
        for iCol in range(nCol):
            new_table_array[iCol][iRow] = table_array[iRow][iCol]
    new_table = []
    for iRow in range(nCol):
        temp_list=[]
        for iCol in range(nRow):
            temp_list.append(new_table_array[iRow][iCol])
        new_table.append(temp_list)
    return new_table
